package io.klaytn.contract.lib

object ByteCodeParserMain {
  val kip7ByteCodes =
    ""

  val kip17ByteCodes =
    ""

  def main(args: Array[String]): Unit = {
    byteCodesToOpCodes()
    extractFunctionSignatures()
  }

  private def byteCodesToOpCodes(): Unit = {
    val parser = new ByteCodeParser()
    parser.byteCodesToOpCodes(kip7ByteCodes).foreach(println)
  }

  private def extractFunctionSignatures(): Unit = {
    val parser = new ByteCodeParser()

    println(parser.extractFunctionSignatures(kip17ByteCodes))
  }
}
